import React, { Component } from 'react';



const productData = [
	{
		name:"Men's Knitwear Offers",
		image:""
	},
	{
		name:"Mens Sweat Shirt",
		image:""
	},
	{
		name:"Mens Sweat Shirt",
		image:""
	},

]

class Products extends Component {

	render(){

		const products = productData.map((d) => {
			<li key={d.name}>{d.name}</li>
		});

		return(
	     	<div>
	     		{products}
	     	</div>
		);
	}
}


export default Products;
